import React from 'react';
import Header from './components/Header';
import Hero from './components/Hero';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      {/* Sections lainnya akan ditambahkan di sini */}
      <section className="section-padding bg-white">
        <div className="container-custom text-center">
          <h2 className="text-3xl md:text-4xl font-bold text-navy-900 mb-8">
            Sections Lainnya Akan Menyusul
          </h2>
          <p className="text-gray-600 max-w-2xl mx-auto">
            Landing page rental mobil yang super keren dengan design modern 
            menggunakan warna putih dan navy. Sections untuk kendaraan, layanan, 
            testimoni, dan footer akan segera ditambahkan.
          </p>
        </div>
      </section>
    </div>
  );
}

export default App;
